function encryptKey(r){for(var e=r.length,n="",t=e+e/5;t<110+e/7*3;t+=e)n+=processorTool.num2Char(t)+"";return encrypt(r,n)}function encrypt(r,e){for(var n="",t=0;t<r.length;t++){var o=r.charAt(t),c=processorTool.char2Num(o),a=e.charAt(t%e.length),u=processorTool.char2Num(a);n+=processorTool.num2Char(c+u)+""}return n}function mkKey(){var r=RSA.generate(),e=r.d,n=r.n,t=r.e,o={d:e,n:n},c=JSON.stringify(o),a={e:t,n:n},u=JSON.stringify(a);document.getElementById("publicKey").innerHTML=u,document.getElementById("txtPrivateKey").innerHTML=c}